
"""
# Longest Word in Dictionary through Deleting

Given a string and a string dictionary, find the longest string in the dictionary that can be formed by deleting some characters of the given string. If there are more than one possible results, return the longest word with the smallest lexicographical order. If there is no possible result, return the empty string.

**Example 1:** 
```
Input:
s = "abpcplea", d = ["ale","apple","monkey","plea"]

Output: 
"apple"
```

**Example 2:** 
```
Input:
s = "abpcplea", d = ["a","b","c"]

Output: 
"a"
```

**Note:** 
    1. All the strings in the input will only contain lower-case letters.
    2. The size of the dictionary won't exceed 1,000.
    3. The length of all the strings in the input won't exceed 1,000.
"""

from typing import List
from functools import cmp_to_key

class Solution:
    def findLongestWord(self, s: str, d: List[str]) -> str:
        def compare(s1, s2):
            if len(s1) < len(s2):
                return -1
            elif len(s1) == len(s2):
                if s1 > s2:
                    return -1
                elif s1 == s2:
                    return 0
                else:
                    return 1
            else:
                return 1

        # # Time limit exceeded
        # def lcs(s1, s2):
        #     dp = [[None] * (len(s2) + 1) for i in range(len(s1) + 1)]
        #     for i in range(len(s1) + 1):
        #         for j in range(len(s2) + 1):
        #             if i == 0 or j == 0:
        #                 dp[i][j] = 0
        #             elif s1[i - 1] == s2[j - 1]:
        #                 dp[i][j] = 1 + dp[i - 1][j - 1]
        #             else:
        #                 dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])
        #     return dp[len(s1)][len(s2)]

        # lst = sorted(list(filter(lambda x: lcs(s, x) >= len(x), d)), 
        #              key = cmp_to_key(compare))
        # return lst[-1] if lst else ""

        # Return True if s2 is subsequence of s1
        def isSubsequence(s1, s2):
            i, j = 0, 0
            while i < len(s1) and j < len(s2):
                if s1[i] == s2[j]:
                    j += 1
                i += 1
            return j == len(s2)

        lst = sorted(list(filter(lambda x: isSubsequence(s, x), d)), 
                     key = cmp_to_key(compare))
        return lst[-1] if lst else ""

# "apple"
print(Solution().findLongestWord("abpcplea", ["ale", "apple", "monkey", "plea"]))

